script: |
  super -f text -I q8443.spq | sort > q8443.out

inputs:
  - name: q8443.spq
    data: |
      SELECT DISTINCT - col2, - col2 AS col2 FROM tab2 (FORMAT parquet) WHERE + col0 BETWEEN - col2 AND - - col0;
  - name: tab2

outputs:
  - name: q8443.out
    data: |
      -23	-23
      -40	-40
      -58	-58
